#
# Fun facts:
#
#   - STIR will often delete or reorder tiles, BUT it is order-preserving
#     in cases where there is no good reason to move tiles. So we do often
#     see small consecutive runs of indices.
#
#   - Similarly-colored tiles have similar indices, and often appear near
#     each other in the image.
#
#   - Entire sequences of tiles are often repeated
#
#   - Runs of identical tiles are very common, for a small number of distinct
#     tile indices. (Backgrounds, fills, etc.) This is a special case of the
#     above.
#
#   - In map data which is designed for tile compression, we expect to
#     see longer repeating patterns of tiles.
#

